func (t fileExtentions) ToStrings(items ...FileExtention) []string {
	var results []string

	for _, item := range items {
		results = append(results, item.String())
	}

	return results
}

func (t fileExtentions) ParseFrom(v string, items ...FileExtention) (FileExtention, error) {
	found := t.Invalid
	var ok bool

	for _, item := range items {
		matchers, ok2 := t.parseMap[item]

		if !ok2 {
			continue
		}

		for _, matcher := range matchers {
			if v == matcher {
				found = item
				ok = true
				break
			}
		}

		if ok {
			break
		}
	}

	if !ok {
		list := strings.Join(t.ToStrings(items...), ",")
		return found, t.errf(v, list)
	}

	return found, nil
}

func (t fileExtentions) Parse(v string) (FileExtention, error) {
	return t.ParseFrom(v, t.Values()...)
}

func (t fileExtentions) IsFrom(v string, items ...FileExtention) bool {
	_, err := t.ParseFrom(v, items...)
	return err == nil
}

func (t fileExtentions) Is(v string) bool {
	return t.IsFrom(v, t.Values()...)
}

